import { NavLink } from "react-router-dom";
import classes from "./MainNavigation.module.css";
const MainHeader = () => {
  return (
    <header className={classes.header}>
      <ul className={classes.list}>
        <li>
          <NavLink
            to="/"
            className={({ isActive }) =>
              isActive ? classes.active : undefined
            }
          >
            Home
          </NavLink>
        </li>
        <li>
          <NavLink
            to="/product"
            className={({ isActive }) =>
              isActive ? classes.active : undefined
            }
          >
            Product
          </NavLink>
        </li>
      </ul>
    </header>
  );
};

export default MainHeader;
